import React from "react"
import './newsNav.css'

const NewsNav = (topicsList) => {
    const elements = topicsList.map(item => {
        return (
            <li class="css-cwdrld">
                <a class="css-1wjnrbv" href = "javascript:;">item</a>
            </li>
        );
    });
    return(
        <div class="css-umysuv">
            <ul class="css-397oyn">
                {topicsList.map(topic => {<li class="css-cwdrld">
                    <a class="css-1wjnrbv" href = "javascript:;">topic</a>
                </li>})}
            </ul>
        </div>
    )

}

export default NewsNav
